import React, { useContext } from 'react';
import { StateContext } from "../pages/sokpage";
import { Appstate } from '../types/domain';
import { Grid, Header, Message } from 'semantic-ui-react';

interface Props {
    tittel: string;
    color: 'red' | 'yellow' | 'green';
}

function Kort(props: Props) {
    return (
        <Message>
            <Message.Header>{props.tittel}</Message.Header>
        </Message>

    )
}

function Statuskort() {
    const state = useContext<Appstate>(StateContext);

    return (
        <Grid>
            <Grid.Column width={3}>
                <Kort tittel="Registrert i MVA-registeret?" color={state.enhetsregisterResult && state.enhetsregisterResult.registrertIMvaregisteret ? "green" : "red"} />
            </Grid.Column>
            <Grid.Column width={3}></Grid.Column>
            <Grid.Column width={3}></Grid.Column>
        </Grid>
    )
}

export default Statuskort;
